import React from 'react';

const Explore = ({ favorites, setFavorites }) => {
  const lines = [
    "Are you made of copper and tellurium? Because you're Cu-Te.",
    "Do you have a name, or can I call you mine?",
    "Are you French? Because Eiffel for you.",
    "If you were a vegetable, you‚Äôd be a cute-cumber.",
    "Are you a 45-degree angle? Because you‚Äôre acute-y!"
  ];

  const handleFavorite = (line) => {
    if (!favorites.includes(line)) {
      setFavorites([...favorites, line]);
      alert("‚ù§Ô∏è Added to Favorites!");
    } else {
      alert("Already in favorites!");
    }
  };

  const handleRate = (line, score) => {
    alert(`You rated: "${line}" with ${score} ‚≠ê`);
    // Extend here: store rating in backend/localStorage if needed
  };

  return (
    <div className="container py-5">
      <h2 className="text-center text-danger fw-bold mb-4">
        <i className="bi bi-stars me-2"></i>üî• Explore Pick-Up Lines
      </h2>

      <div className="row">
        {lines.map((line, idx) => (
          <div key={idx} className="col-md-6 col-lg-4 mb-4">
            <div className="card shadow-sm border-0 rounded-4 h-100">
              <div className="card-body d-flex flex-column justify-content-between">
                <p className="card-text fs-5 text-dark">üí¨ {line}</p>
                <div className="d-flex justify-content-between align-items-center mt-3">
                  <div>
                    {[1, 2, 3, 4, 5].map((star) => (
                      <button
                        key={star}
                        className="btn btn-sm btn-outline-warning me-1"
                        onClick={() => handleRate(line, star)}
                      >
                        ‚≠ê
                      </button>
                    ))}
                  </div>
                  <button
                    className="btn btn-sm btn-outline-danger"
                    onClick={() => handleFavorite(line)}
                  >
                    ‚ù§Ô∏è Favorite
                  </button>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Explore;
